import React from 'react';
import './Badge.css';
import PropTypes from 'prop-types';

const Badge = ({number}) => {
  if (number > 50) {
    return (
      <div className="badgeNumber red">Notifications {number}</div>
    );
  } else {
    return (
      <div className="badgeNumber green">{number}</div>
    );
  }
}

Badge.propTypes = {
  url: PropTypes.number
};

export default Badge;
